import React from 'react';
import './Header.css';
import profile from './Images/profilePic.png';
import triple from './Images/TripleLine.png';


function Heading() {
  return (
    <div className="Header-Div">
      <div className="Row">
        <div className="Header-Middle">
          <button id="tripleButton">
            <img
              src={triple}
              alt=""
            />
          </button>
        </div>
        <div className="Header-Middle">
          <p>Game Recommendation App</p>
        </div>
        <div className="Header-Middle">
          <img
              src={profile}
              alt=""
            />
        </div>
      </div>
    </div>
  );
}

export default Heading;
